import { PointSet } from './point_set';
import { Vector2 } from '../../../../utility/math_extended/vector2';

export class PolygonPointSet extends PointSet {
  protected _vertices: Array<Vector2> = new Array<Vector2>();

  public get vertices() {
    return this._vertices;
  }

  public addVertice(vertice: Vector2) {
    this._vertices.push(vertice);
  }

  constructor(vertices: Array<Vector2> = []) {
    super();
    this._vertices = vertices;
  }

  static CreateBox(size: Vector2, offset: Vector2 = new Vector2()): PolygonPointSet {
    var theReturn = new PolygonPointSet([
      new Vector2(-size.x / 2, size.y / 2).add(offset),
      new Vector2(size.x / 2, size.y / 2).add(offset),
      new Vector2(size.x / 2, -size.y / 2).add(offset),
      new Vector2(-size.x / 2, -size.y / 2).add(offset)
    ]);

    return theReturn;
  }

  static CreateCircle(radius: Vector2, offset: Vector2, roughness: number = 15): PolygonPointSet {
    var theReturn = new PolygonPointSet();
    var step = (2 * Math.PI) / roughness;
    
    for (var theta = 0; theta < 2 * Math.PI; theta += step) {
      var x = (radius.x / 2) * Math.cos(theta);
      var y = (radius.y / 2) * Math.sin(theta);
      var vertice = new Vector2(x, y);
      theReturn.addVertice(vertice.add(offset));
    }

    return theReturn;
  }
}
